Радіо М це:
- незалежна українська радіостанція інформаційно - розважального напрямку;
- простір, де обговорюються питання, з яких складається наше життя;
- різноманітна і актуальна інформація;
- цікаві гості: лікарі, спортсмени, волонтери, працівники культури, представники релігійних організацій;
- цікаві авторські проекти;
- багато музики різних жанрів.
